import React from 'react'

const Delete = (props) => {
    return (props.trigger)?(
        <div>
             <h3>Do you want to delete this item?</h3>
            <button className="link" onClick={() => props.deleteUser(props.id)}>Yes</button>
            <button onClick={()=>props.setTrigger(false)}> No</button>
        </div>
    ):"";
}

export default Delete
